import React from 'react';
import { Row, Col, Card, Button } from 'react-bootstrap';

function Home() {
  const featuredProducts = [
    { 
      name: 'Kue Lapis Tradisional', 
      description: 'Kue lapis spesial dari resep warisan keluarga',
      image: '/images/kue-lapis.jpg'
    },
    { 
      name: 'Dodol Nusantara', 
      description: 'Dodol berkualitas premium dari berbagai daerah',
      image: '/images/dodol.jpg'
    }
  ];

  return (
    <div className="home-page">
      <div className="hero-section text-center my-5">
        <h1>Dapur Warisan</h1>
        <p>Melestarikan Cita Rasa Tradisional Indonesia</p>
        <Button variant="primary">Jelajahi Produk</Button>
      </div>

      <Row className="featured-products">
        {featuredProducts.map((product, index) => (
          <Col key={index} md={6}>
            <Card className="mb-4">
              <Card.Img variant="top" src={product.image} />
              <Card.Body>
                <Card.Title>{product.name}</Card.Title>
                <Card.Text>{product.description}</Card.Text>
                <Button variant="outline-primary">Lihat Detail</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </div>
  );
}

export default Home;
